const text = document.querySelector('.text');
let startTime = Date.now(); // Start the custom clock

function animateText() {
    const elapsedTime = (Date.now() - startTime) / 1000; // Time in seconds

    // Find the closest frequency data point to the current time
    const closestDataPoint = frequencyData.reduce((prev, curr) => {
        return Math.abs(curr.time - elapsedTime) < Math.abs(prev.time - elapsedTime) ? curr : prev;
    });

    // Pulse effect based on frequency
    const frequency = closestDataPoint.frequency;
    // Using a smaller multiplier for even more subtle pulsation
    const pulseIntensity = Math.sin(elapsedTime * Math.PI * 3); // Fast pulse with a sin function
    const scale = 1 + (pulseIntensity * (frequency * 4)); // Further reduced scale multiplier

    // Ensure the scale doesn't go below 1 (original size)
    text.style.transform = `scale(${Math.max(1, scale)})`;

    // Continue the animation loop
    requestAnimationFrame(animateText);
}

// Start the animation
